DROP DATABASE IF EXISTS CFEA;
CREATE DATABASE CFEA;
use CFEA;
DROP TABLE IF EXISTS meta;

CREATE TABLE meta(
  sample char(20),
  GSM char(20),
  diseases char(50),
  gender char(20),
  age char(20),
  PMID char(20),
  technical char(20),
  method char(50),
  term char(20),
  source char(20),
  drug_response char(50),
  stage char(20),
  metastasis char(20),
  adapter_content char(5),
  duplication_level char(5),
  base_quality char(20),
  basic_statistics char(20),
  overrepresented_sequences char(20),
  overall_alignment_rate char(20),
  qc_pass char(20)
)ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

